import React from 'react';
import Ho from './Picture/home.png'

import './Box.css' ;

function Box (){
  const [data, setData] = useState([]);
  useEffect(() => {
    axios.get('http://localhost:8081/')
      .then(res => setData(res.data))
      .catch(err => console.log(err))
  }, []);

  const headleDelete = (N) => {
    axios.delete('http://localhost:8081/delete/' + N)
      .then(res => {
        window.location.reload();
      })
      .catch(err => console.log(err))

  }
  return (
            <>
                <div className="Box" >{data.map((car, index) => {
              return <tr key={index}>
                <td>{car.numcar}</td>
                <td>{car.bran}</td>
                <td>{car.model}</td>
                <td>{car.note}</td>
                <td>

                  <Link to={`/Edit/${car.N}`} className='btn btn-secondary'>EDIT</Link>
                  <button onClick={() => headleDelete(car.N)} className='btn btn-danger'>DELETE</button>
                </td>
              </tr>
            })}</div>
            </>
      
    
  );


}

export default Box;
